import React from 'react'
import Header from '../Header/Header'

function Listings() {
  return (
    <div className="Listings">
      <div className="first">
        <Header />
      </div>
      <div className="second">2</div>
      <div className="third">3</div>
    </div>
  );
}

export default Listings
